import RayaAxiosClient from './raya-axios-client';

const getAllApplicants = async () => {
  console.log('[applicantsService] getAllApplicants:');
  const result = await RayaAxiosClient.get('http://localhost:8080/api/admin/applicants');
  return result;
};

export default {
  getAllApplicants,
};
